// Class to manage icons
class Icon extends HTMLElement {
  static get observedAttributes() {
    return ["name"];
  }

  get name() {
    return this.getAttribute("name");
  }

  set name(newName) {
    this.setAttribute("name", newName);
  }
  
  constructor(initName) {
    super();
    
    let style = document.createElement("style");
    style.textContent = `saco-icon {display: inline-block; height: 1em;} saco-icon svg {display: inline-block; height: 100%; width: 100%; min-height: 100%; min-width: 100%;} saco-icon svg *[fill] {fill: currentColor;} saco-icon svg *[stroke] { stroke: currentColor;}`
    
    this.update = () => {
      let loop = (name) => {
        try {
          let split = name.split(".");
          let look = icons;
          for (let i in split) {
            look = look[split.slice(i).join(".")] || look[split[i]];
            if (typeof look == "string") return look;
          }
        } catch (err) {}
      }
      let symbol = loop(this.name);
      this.innerHTML = loop(this.name);
      if (!symbol) {
        this.innerHTML = "￼";
        console.warn(`Failed to load icon "${this.getAttribute("name")}".`);
        this.title = this.getAttribute("name");
        this.onclick = (event) => {
          alert(`😵‍💫 Icon "${this.getAttribute("name")}" couldn't be found.`);
        }
      }
      this.append(style);
    }

    if (initName) this.name = initName;
  }
  
  connectedCallback() {
    this.update();
  }

  attributeChangedCallback(name, older, newer) {
    this.update();
  }
};

customElements.define("saco-icon", Icon);